import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './Home';
import EnergyAndGlobalWarming from './EnergyAndGlobalWarming';
import RenewableEnergy from './RenewableEnergy';
import MineralsExtraction from './MineralsExtraction';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/energy-and-global-warming" component={EnergyAndGlobalWarming} />
        <Route path="/renewable-energy" component={RenewableEnergy} />
        <Route path="/minerals-extraction" component={MineralsExtraction} />
      </Switch>
    </Router>
  );
}

export default App;
